import React from 'react';
import logo from './logo.svg';
import './App.css';

import Header from './components/header/Header';
import Footer from './components/footer/Footer';
import Home from './components/pages/Home';

function App() {
  return (
    <div className="App">
        <Header />

        <Home />

        <Footer />
    </div>
  );
}

export default App;
